<!doctype html>
<html>
    <head>
        <meta charset="utf-8">
        <title>Routine Manager</title>

        <!-- build:css styles/main.css -->
        <link rel="stylesheet" href="ember-app/.tmp/styles/style.css">
        <link rel="stylesheet" href="ember-app/app/bower_components/bootstrap-datepicker/css/datepicker3.css">
        <!-- endbuild -->
</head>
    <body>

        <!-- build:js(app) ember-app/scripts/components.js -->
        <script src="ember-app/app/bower_components/jquery/jquery.js"></script>
        <script src="ember-app/app/bower_components/handlebars/handlebars.js"></script>
        <script src="ember-app/app/@@ember"></script>
        <script src="ember-app/app/@@ember_data"></script>
        <script src="ember-app/app/bower_components/ember-addons.bs_for_ember/dist/js/bs-core.max.js"></script>
        <script src="ember-app/app/bower_components/ember-addons.bs_for_ember/dist/js/bs-alert.max.js"></script>
        <script src="ember-app/app/bower_components/ember-addons.bs_for_ember/dist/js/bs-modal.max.js"></script>
        <script src="ember-app/app/bower_components/ember-addons.bs_for_ember/dist/js/bs-button.max.js"></script>
        <script src="ember-app/app/bower_components/ember-simple-auth/ember-simple-auth.js"></script>
        <script src="ember-app/app/bower_components/ember-simple-auth/ember-simple-auth-oauth2.js"></script>
        <!-- endbuild -->

        <!-- build:js(.tmp) ember-app/scripts/templates.js -->
        <script src="ember-app/.tmp/scripts/compiled-templates.js"></script>
        <!-- endbuild -->

        <!-- build:js(.tmp) ember-app/scripts/main.js -->
        <script src="ember-app/.tmp/scripts/combined-scripts.js"></script>
        <!-- endbuild -->

        <!-- build:js ember-app/scripts/plugins.js -->
        <script src="ember-app/app/bower_components/bootstrap-sass/js/affix.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/alert.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/dropdown.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/tooltip.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/modal.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/transition.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/button.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/popover.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/carousel.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/scrollspy.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/collapse.js"></script>
        <script src="ember-app/app/bower_components/bootstrap-sass/js/tab.js"></script>

        <script src="ember-app/app/bower_components/bootstrap-datepicker/js/bootstrap-datepicker.js"></script>
        <!-- endbuild -->

        <script src="ember-app/app/bower_components/momentjs/moment.js" type="text/javascript" charset="utf-8"></script>
</body>
</html>
